    jQuery('.gf-category-expander__footer .fas ').click(function () {
        if (jQuery('#gf-expander-id').hasClass('gf-height-test')) {
            jQuery('#gf-expander-id').removeClass('gf-height-test');
        } else {
            jQuery('#gf-expander-id').addClass('gf-height-test');
        }
    });

